  }));
};

UilCircuit.propTypes = {
  color: PropTypes.string,
  size: PropTypes.oneOfType([PropTypes.string, PropTypes.number]),
};

UilCircuit.defaultProps = {
  color: 'currentColor',
  size: '24',
};

export default UilCircuit;
